    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT - col1 - - col0 NOT IN ( + col0, - col0 / - 39, col2 * + col0 + + col1, + col1 / col1, + + ( + - col1 ) * + 62 / + col0 + + - col2 );
  - name: tab2

outputs:
  - name: q1935.out
    data: |
